// randomAttributes.js

const attributesPool = {
    health: ["Отличное", "Хорошее", "Удовлетворительное", "Плохое"],
    profession: ["Врач", "Инженер", "Учитель", "Художник", "Повар", "Программист"],
    hobby: ["Рисование", "Чтение", "Спорт", "Музыка", "Путешествия", "Готовка"],
    age: ["18", "25", "30", "40", "50", "60"],
    phobia: ["Замкнутые пространства", "Высота", "Темнота", "Насекомые", "Толпа", "Одиночество"],
  };
  
  const shuffleArray = (array) => {
    const shuffled = [...array];
    for (let i = shuffled.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
    }
    return shuffled;
  };
  
  const generateRandomAttributes = () => {
    const selectedAttributes = {};
    Object.keys(attributesPool).forEach((key) => {
      const shuffled = shuffleArray(attributesPool[key]);
      selectedAttributes[key] = shuffled.pop();
    });
    return selectedAttributes;
  };
  
  export default generateRandomAttributes;
